import React from "react";

const Service = () => {
  <>
    <div className="my-5">
      <h1 className="text-center">Our services</h1>
    </div>
    <div className="container-fluid nav-bg">
      <div className="row">
        <div className="col-10 mx-auto"></div>
      </div>
    </div>
  </>
};
export default Service;
